import styled from 'styled-components'

const Outer = styled.footer`
    height: 50px; 
    width: 100%;
    background-attachment: fixed;
    background-position: 0% 0%;
    position: fixed;
    bottom: 0pt;
    left: 0pt;
`
export default Outer
